description:
The files in this .ZIP archive are copied from an original CD-ROM.  Made for DOS; DOSbox recommended for use to run the game.  It can be aquired from    &lt;a href=&quot;
http://dosbox.sourceforge.net/news.php?show_news=1&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://dosbox.sourceforge.net/news.php?show_news=1&lt;/a&gt;
Installation instructions (in .TXT) included.  Icon file and original manual (in .PDF) also included.  Needs no update (CD ver. 1.22h).

This is actually a re-release--this copy, however, has a better .PDF of the original manual that also includes a map of the game world.  Enjoy!
